;; **
;;; # Complexity Reduction
;;; 
;;; We'd like to infer what "order" of program complexity savings probabilistic programming saves.
;; **

;; @@
(ns complexityreduction
  (:require [gorilla-plot.core :as plot])
  (:use clojure.repl
        [mrepl core]
        [embang runtime emit]
        [anglib crp]
        [clojure.string :only (join split blank?)]))
;; @@
