;; **
;;; It's very unclear what the regression relationship between the input (original program length) and output (Anglican program length)
;; **

;; @@
(defn logb [b x] (/ (log x) (log b)))
(map (partial logb 2) (map first data))
(sample (discrete (range 3)))
(sample (gamma 1 0.5))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.6240868624760365</span>","value":"1.6240868624760365"}
