;; **
;;; (Math/log 7)
;; **

;; **
;;; Now that we have a data source (even), we can try to learn the structure of the automata.
;; **

;; @@
  (with-primitive-procedures [logb] 
    (defquery which-reduction  
    (let [which (sample (discrete [1 1]))
          _ (prn which)
          func (case which 
                     0 (let [base (sample (gamma 1 0.5))
                             ;_ (prn base)
                             offset (sample (normal 0 100))
                             ;_ (prn offset)
                             ]
                          (fn [x] (+ (logb base x) offset)))
                     1 (let [slope (sample (normal 0 100))
                             ;_ (prn slope)
                             offset (sample (normal 0 100))
                             ;_ (prn offset)
                             ]
                          (fn [x] (+ (* slope x) offset)))
                    
                )
          ;_ (prn func)
          ]
      (map (fn [x] (observe (normal 0 10) (- (second x) (func (first x))))) data)
      (predict :which which)
      )))
